import { useEffect, useState } from "react";
import axios from "axios";
import "./Projects.css";

const BASE_URL = "http://localhost:5000";

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [activeProject, setActiveProject] = useState(null);

  /* ================= FETCH PROJECTS ================= */
  const fetchProjects = async () => {
    try {
      const res = await axios.get(`${BASE_URL}/lily`);
      const data = res.data.data || [];

      const safeData = data.map((p) => ({
        ...p,
        images: Array.isArray(p.images) ? p.images : [],
        floorPlans: Array.isArray(p.floorPlans) ? p.floorPlans : [],
        amenities: Array.isArray(p.amenities) ? p.amenities : [],
        geoLocation: p.geoLocation || {},
      }));

      setProjects(safeData);
    } catch (err) {
      console.error("Fetch error:", err);
    }
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  /* ================= UI ================= */
  return (
    <div className="projects-wrapper">
      <h2>Projects</h2>

      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Type</th>
            <th>Location</th>
            <th>Geo (lat,lng)</th>
            <th>Amenities</th>
            <th>Actions</th>
          </tr>
        </thead>

        <tbody>
          {projects.map((p, i) => (
            <tr key={p.id}>
              <td>{i + 1}</td>
              <td>{p.projectName}</td>
              <td>{p.projectType}</td>
              <td>{p.location}</td>
              <td>
                {p.geoLocation?.coordinates?.length === 2
                  ? `${p.geoLocation.coordinates[1]}, ${p.geoLocation.coordinates[0]}`
                  : "-"}
              </td>
              <td>{p.amenities.join(", ") || "-"}</td>
              <td>
                <button className="view-btn" onClick={() => setActiveProject(p)}>
                  View Details
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ================= MODAL ================= */}
      {activeProject && (
        <div className="modal">
          <div className="modal-box">
            <h3>{activeProject.projectName}</h3>

            <p><b>Type:</b> {activeProject.projectType}</p>
            <p><b>Location:</b> {activeProject.location}</p>

            {/* ================= PROJECT IMAGES ================= */}
            <h4>Project Images</h4>
            {activeProject.images.length > 0 ? (
              <div className="gallery">
                {activeProject.images.map((img, idx) => (
                  <img
                    key={idx}
                    src={`${BASE_URL}/${img}`}
                    alt="project"
                  />
                ))}
              </div>
            ) : (
              <p>No images available</p>
            )}

            {/* ================= FLOOR PLANS ================= */}
            <h4>Floor Plans</h4>
            {activeProject.floorPlans.length > 0 ? (
              <div className="gallery">
                {activeProject.floorPlans.map((fp, idx) => (
                  <img
                    key={idx}
                    src={`${BASE_URL}/${fp}`}
                    alt="floor plan"
                  />
                ))}
              </div>
            ) : (
              <p>No floor plans available</p>
            )}

            <button className="close-btn" onClick={() => setActiveProject(null)}>
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
